import * as React from 'react';
import {Paper, styled} from "@mui/material";


const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    textAlign: 'center',
    color: theme.palette.text.secondary,
    height: 60,
    lineHeight: '60px',
}));

export const Card = () => {
    return (
        <div>
            <Item elevation={16}>
                {`Card 1`}
            </Item>
        </div>
    );
};
